function ifScript() {
	var dAo = current.debit_ao_approver;
	var cAo;
     
	 var gr = new GlideRecord('cmn_department');
		gr.addQuery('sys_id', current.service_provider_division);		
		gr.query();
	
        if(gr.next())  {
			cAo=gr.u_administrator_officers;
			var lArray =cAo.split(',');
		}
	if (lArray.length ==1){
		if(lArray[0]==dAo)
			return 'yes';
		else
			return 'no';
	}
		
}

